const Index = () => (
  <div>
    <div className="nav"></div>
    <p>Hello World!</p>

  <style jsx global>{`
  body {
    background-color: hsl(0, 0%, 7%);
  }

  .nav {
    border-bottom: 1px solid rgba(0,0,0,0.25); 
    height: 46px; 
    position: relative; 
    width: 100%;
    top: 0;
    right: 0;
    left: 0 
  }
`}</style>
</div>
)

export default Index
